import React from 'react';
import './nav.css';

function Nav(){
	return (
		<div className="nav">
		  <img class="nav_logo" src="https://upload.wikimedia.org/wikipedia/commons/0/0f/Logo_Netflix.png" alt="Netflix Logo" />

		  <img class="nav__avatar" src="https://pbs.twimg.com/profile_images/1240119990411550720/hBEe3tdn_400x400.png" alt="Netflix Logo" />
		</div>
	)
}

export default Nav;
